import BoomerangAnimated from './boomerang-animated.png';

const BoomerangAmmo = {
    name: 'boomerang',
    target: 'enemy',
    size: { width: 40, height: 40, total: 560 },
    sprite: BoomerangAnimated,
    information: 'threw a',
};

export default BoomerangAmmo;
